const Cart = (props) => {



    return(

        <CartContainer>
        <label>
            <h1></h1>
            <input type="number" onChange={props.quantia()} value={props.amount} />
            <input type="cart" onChange={props.carrinho()} value={props.cart} />
        </label>


        </CartContainer>



    )
}

export default Cart
